/* eslint-disable no-undef */
import React from 'react';

const Tweet = ({tweets}) => (
    <>
        <div>
            {tweets.map((thistweet, i) => 
            <div className="tweet" key={i}>
                <p>{thistweet.created_at}</p>
                <p>{thistweet.text}</p> 
                <p>{thistweet.source}</p>
                <p>{thistweet.reply_count} replies and {thistweet.retweet_count} retweets</p>
            </div>
            )}
            {tweets.user && Object.keys(tweets.user).map((key, index) =>
                <div key={index}>
                    <p>{tweets.user[key]}</p>
                </div>
            )}
        </div> 
    </>
) 


export default Tweet;
